My Beautiful Dark Twisted Fantasy is the fifth studio album by American hip hop recording artist Kanye West, released on November 22, 2010, through Roc-A-Fella Records. Following a hiatus from his music career, West worked on it through a communal development that involved him and other musicians and producers contributing collectively to its music. Recording sessions took place primarily at Avex Recording Studio in Honolulu, Hawaii during 2009 to 2010. Production was handled by West and several other record producers, including Jeff Bhasker, RZA, No I.D., and Mike Dean, among others.

